import React, { Fragment } from "react";
import { withRouter } from "react-router-dom";
function KnowledgeBase(props) {
  return (
    <Fragment>
      <div className="main">Knowledge Base</div>
    </Fragment>
  );
}
export default withRouter(KnowledgeBase);
